(107, 488689, 'Uma Quase Dupla', '2018-03-01', 'pt', '', 'http://image.tmdb.org/t/p/w185', 8.88235),
(108, 498118, 'A tu lado', '2018-03-01', 'es', 'Alessandra Fuller encarnará a Paz, una jovencita que, sumida en sus tristezas, es invitada a Punta Cana por su tío Martín, quien es gerente en uno de los hoteles más prestigiosos del lugar, allí conocerá a Edú (Andrés Vilchez) quien trabaja como salvavidas en el hotel, esta historia de amor embarcará a ambos personajes en un viaje frenético pero divertido.', 'http://image.tmdb.org/t/p/w185/pt9kQPbUHBWV5SAiXbFl49YO4uS.jpg', 9.05167),
(109, 503586, 'High Alert', '2018-03-01', 'en', '', 'http://image.tmdb.org/t/p/w185/sMAu6WIhVsrJdq88gBnx2JP3m7W.jpg', 12.4316),
(110, 373450, 'Dark Night', '2018-03-01', 'en', '', 'http://image.tmdb.org/t/p/w185/pwymt8MarrCIdsT4YlSJMzbuTgf.jpg', 2.673),
(111, 395990, 'Death Wish', '2018-03-02', 'en', 'La historia se basa en una novela del mismo nombre donde el protagonista es un arquitecto, felizmente casado, y con una hija adorable. Pero la desgracia quiere que madre e hija sean víctimas de tres desaprensivos que las siguen a la salida de un supermercado hasta la casa de la primera. Allí serán asaltadas brutalmente, a resultas de lo cual muere la madre y la otra queda absolutamente traumatizada. Tras comprobar que muy poco cabe esperar de la policía, el protagonista inicia una venganza por su cuenta, al enfrentarse con todo delincuente que se le ponga a tiro. (FILMAFFINITY)', 'http://image.tmdb.org/t/p/w185/zRpOwIlOXZZVWgDernbPbdHU5cl.jpg', 22.683),
(112, 353066, 'The Vanishing of Sidney Hall', '2018-03-02', 'en', 'El joven escritor Sidney Hall escribe un libro que definió a su generación y le hizo mundialmente famoso. Pero la fama amenaza con destruirle y más tarde desaparece sin dejar rastro. El declive de su carrera profesional se aprecia a medida que van pasando los años y este largometraje lo muestra a través de sus dieciocho, veinticuatro y treinta años.', 'http://image.tmdb.org/t/p/w185/e8SJJEliAK9g0EG5agPsbxWoWoI.jpg', 16.7827),
(113, 461649, 'Pari', '2018-03-02', 'hi', '', 'http://image.tmdb.org/t/p/w185/togwv0TGqXkIA2YuYIY9VDLEkdF.jpg', 8.60339),
(114, 480394, 'They Remain', '2018-03-02', 'en', '', 'http://image.tmdb.org/t/p/w185/pCsB2IePfLj5eQXXziGb8Xyxblm.jpg', 12.267),
(115, 457312, 'Pickings', '2018-03-02', 'en', '', 'http://image.tmdb.org/t/p/w185/s8NQvpJMOM1iC8hiFwvR5hywxO9.jpg', 12.3899),
(116, 487741, 'Kääntöpiste', '2018-03-02', 'fi', '', 'http://image.tmdb.org/t/p/w185/rCwKHDH61tIB6tb4Mlm1gLm0inI.jpg', 9.87722),
(117, 485348, 'La vida lliure', '2018-03-02', 'ca', 'Es 1915, y Tina y Biel descubren un valioso tesoro en su isla de Menorca y deciden utilizarlo como moneda de cambio para poder viajar con su madre a Argel, que ya está allí buscando trabajo. El mayor deseo de estos dos hermanos es llegar al país africano y para conseguirlo piden ayuda a Rom, un hombre solitario que no rinde cuentas a nadie.', 'http://image.tmdb.org/t/p/w185/5woPayatcxlGWJ3hQ4VFp3ASCEB.jpg', 7.64865),
(118, 495193, 'Benji', '2018-03-02', 'en', '', 'http://image.tmdb.org/t/p/w185/1wLnkdSEA2g6552QrjfdAB2eVC7.jpg', 8.504),
(119, 498737, '素敵なダイナマイトスキャンダル', '2018-03-02', 'ja', '', 'http://image.tmdb.org/t/p/w185/1gVkRpmTncktEMozzZKOL0TAD3J.jpg', 8.67807),
(120, 505015, 'Sin rodeos', '2018-03-02', 'es', 'Paz tiene una vida aparentemente perfecta. Tiene trabajo, pareja, amigas… pero algo falla. Se siente angustiada y agobiada, hay algo que no funciona. En su desesperación acudirá a la consulta de un “sanador” indio Amil Narayan, que le ofrece la solución a sus problemas: una poción a base de plantas milenarias para liberar su tensión. La poción parece más potente de lo esperado. Paz se encuentra con un resultado sorprendente, convirtiéndose, tras ingerir accidentalmente todo el frasco, en una mujer \"sin filtro\"... Remake de la comedia \"Sin filtro\" del chileno Nicolás López. Primera película dirigida por Segura fuera de la saga \"Torrente\".', 'http://image.tmdb.org/t/p/w185/tYHwRGyPRJO1HvmjyOvStAz7KD1.jpg', 9.95786),
(121, 503128, 'Now It\'s Dark', '2018-03-02', 'no', '', 'http://image.tmdb.org/t/p/w185/lNd8K2ypTZ60Gx27tOJRhLvbw1.jpg', 8.10921),
