(127, 477033, 'Errementari', '2018-03-02', 'eu', 'Basada en el cuento folklórico vasco \"Patxi herremaria\", recogido por el sacerdote, arqueólogo y antropólogo José Migel de Barandiarán en 1903, la historia se desarrolla en el País Vasco en 1845, en un universo habitado por criaturas diabólicas mitológicas, luchando por capturar el almas de los inconscientes.', 'http://image.tmdb.org/t/p/w185/ksFC8wyCEAfDw54aD5ky1eT8b40.jpg', 10.6187),
