(129, 366964, 'Mohawk', '2018-03-02', 'en', 'Hacia finales de la Guerra de 1812, una joven mujer Mohawk y sus dos amantes pelean contra un pelotón de soldados americanos que buscan venganza.', 'http://image.tmdb.org/t/p/w185/hGZE7BeHzTOarIbjSzlGbIc8sPr.jpg', 10.786),
