(285, 504345, 'La tribu', '2018-03-16', 'es', 'Basado en hechos reales, La tribu cuenta la historia de Virginia, una mujer trabajadora que recupera el contacto con su hijo Fidel, que fue dado en adopción.  Para disfrutar del tiempo libre, Virginia se ha unido a un grupo de baile de streetdance (\'Las Mamis\') cuyo ritmo le alegra y anima; además de salir de la monotonía de la vida diaria.  Mientras ambos comienzan a conocerse y crear una unión de madre-hijo, el baile supondrá un nexo entre ellos en el que descubren que más allá de tener en común el parentesco, en la sangre llevan el ritmo.  La tribu es una película de comedia dirigida por Fernando Colomo (Isla bonita, Al sur de Granada) que cuenta con la presencia de Carmen Machi (Pieles, Ocho apellidos vascos) y Paco León (Embarazados, Kiki, el amor se hace) entre otros.', 'http://image.tmdb.org/t/p/w185/iFrqw3uWFHAPHIDBcVKtMLPLKNP.jpg', 2.63352),
