(345, 476968, 'Pablo, el apóstol de Cristo', '2018-03-28', 'en', 'Pablo sufre en soledad en una prisión romana, a la espera de su ejecución por orden del emperador Nerón. A Mauricio, el ambicioso prefecto de la prisión, le cuesta imaginar qué clase de peligro podría suponer este hombre destrozado. En otro tiempo, fue Saulo de Tarso, un brutal asesino de cristianos de alto rango. Ahora, su fe inquieta a Roma. Corriendo un gran riesgo, Lucas, el galeno, visita al anciano Pablo para confortarlo y atenderlo... así como para preguntarle, transcribir y sacar clandestinamente las cartas de Pablo a la creciente comunidad de creyentes. Pese a la inhumana persecución a la que los somete Nerón, estos hombres y mujeres difundirán el Evangelio de Jesucristo y cambiarán el mundo.', 'http://image.tmdb.org/t/p/w185/7vQ9c0tAbeex6vH5NTkSG579e3n.jpg', 2.86658),
