(434, 460019, 'Truth or Dare', '2018-04-13', 'en', 'Una estudiante universitaria es perseguida por una presencia sobrenatural después de ser engañado para jugar al juego de \"Verdad o atrevimiento\".', 'http://image.tmdb.org/t/p/w185/kdkNaQYZ7dhM80LsnAGKpH8ca2g.jpg', 4.46809),
