(438, 427641, 'Rampage', '2018-04-13', 'en', 'El primatólogo Davis Okoye (Johnson), un hombre que mantiene las distancias con otras personas, tiene un sólido vínculo con George, el extraordinariamente inteligente gorila de espalda plateada al que ha estado cuidando desde que nació. Pero cuando un experimento genético sale mal, este apacible simio se convierte en una enorme y embravecida criatura. Para empeorar más las cosas, pronto se descubre que existen otros animales con la misma alteración. Cuando estos depredadores alfa recién creados arrasan Norteamérica destruyendo todo lo que interpone en su camino, Okoye se une a un ingeniero genético sin prestigio para conseguir un antídoto y se abre paso en un cambiante campo de batalla, no solo para frenar una catástrofe mundial sino para salvar a la aterradora criatura que una vez fue su amigo. Adaptación al cine del videojuego \"Rampage\", en el que simios y monstruos de todo tipo atacan y destruyen ciudades.', 'http://image.tmdb.org/t/p/w185/30oXQKwibh0uANGMs0Sytw3uN22.jpg', 6.64354),
