(529, 423994, 'La huella del pasado', '2018-05-04', 'en', 'Esta es una película sobre madres e hijas y sobre el impacto que dejan en el presente los fantasmas del pasado. Basada en la historia real de Helga Schneider, Let Me Go explora el efecto que causó en la vida de Helga el hecho de ser abandonada por su madre, Traudi, en 1941, cuando sólo tenía 4 años. El film está ambientado en el año 2000, y sigue, no sólo las vidas de Helga y Traudi; también la de sus dos siguientes generaciones: Beth, la hija de Helga, y Emily, su nieta, que aún tienen que lidiar con los efectos a largo plazo de la marcha de Traudi. Cuando Helga recibe una carta anunciando que Traudi pronto morirá, decide viajar hasta Viena junto a Emily para que conozca a la abuela que hasta ahora creía muerta. En este viaje, descubrirá los secretos más oscuros de su familia.', 'http://image.tmdb.org/t/p/w185/cbLy3wbsX0HInFYSMaUSujbsIbW.jpg', 1.43941),
(530, 341689, 'How to Talk to Girls at Parties', '2018-05-05', 'en', 'Basada en un  cuento corto que fue nominado al premio Hugo, nos cuenta una historia de amor ambientada en los años 70 que se centra en un joven punk que usa su música y su arte como forma de escape y en una joven alienígena de visita turística a la Tierra y se escapa de su grupo para explorar el lugar más peligroso de la galaxia, el suburbio londinense de Croydon.', 'http://image.tmdb.org/t/p/w185/tyCt5dQ2yhfEtWcP3KqMgtFk7s0.jpg', 2.66284),
