(764, 433498, 'Papillon', '2018-08-24', 'en', 'Red Granite Pictures produce esta nueva versión del clásico homónimo de 1973 dirigido por Franklin J. Schaffner y protagonizado por Steve McQueen y Dustin Hoffman. La película narraba la historia de Henri Charriere \"Papillon\", un hombre encarcelado por un crimen que no ha cometido. Por eso es enviado a una prisión de la Guayana Francesa, donde salva la vida a uno de sus compañeros presos, Louis Dega, un falsificador de documentos que decidirá ayudarle a escapar de la cárcel. Juntos trazan un plan de fuga.', 'http://image.tmdb.org/t/p/w185', 2.38345),
