(766, 434555, 'Cadaver', '2018-08-24', 'en', 'Un policía que acaba de salir de rehabilitación comienza a trabajar en una morgue del hospital de la ciudad. Poco a poco, irá descubriendo una serie de extraños y violentos sucesos causados por una entidad maligna que procede de uno de los cadáveres.', 'http://image.tmdb.org/t/p/w185', 2.38874),
