(779, 320846, 'Sky Sharks', '2018-09-01', 'en', 'Sky Sharks es una película dirigida por Marc Fehse (Sex, Dogz and Rock n Roll) y escrita junto a A. D. Morel que cuenta la historia de un grupo de geólogos que viaja al Ártico para descubrir un laboratorio que utilizaban los nazis en los últimos días de la Segunda Guerra Mundial para realizar experimentos. Al encontrar el laboratorio, por accidente los geólogos activan el último experimento de los nazis: tiburones modificados genética y tecnológicamente. Los tiburones causan el caos y un grupo especializado debe frenarlos con armas si no quieren que toda la situación se convierta en un gran desastre con repercusiones terribles.', 'http://image.tmdb.org/t/p/w185/tAlPkLbyGujJ86P7I7oApXhHaRe.jpg', 3.84851),
