(874, 426543, 'El Cascanueces y los cuatro reinos', '2018-10-26', 'en', 'La historia relata las aventuras de Clara, una niña que recibe como regalo de Navidad un cascanueces. Su hermano está celoso y lo rompe, aunque por suerte el juguete puede ser arreglado. La pequeña, contenta, se levanta por la noche para abrazar a su cascanueces, que en ese momento se transforma y la lleva a un mundo mágico. En él las flores conviven con los copos de nieve y un sin fin de chucherías. Pero no todo va será bueno allí, pues Clara se encontrará en mitad de una guerra entre los hombres de jengibre y el rey de los ratones.', 'http://image.tmdb.org/t/p/w185/5NvwC4FuHw3s1HCRu53LJDsWszE.jpg', 3.65843),
