(948, 324857, 'Spider-Man: Un nuevo universo', '2018-12-12', 'en', 'Trabajando en las sombras para seguir manteniendo su identidad en secreto, las relaciones se volverán más difíciles de compaginar con sus actividades de defensor de la justicia. Última pieza en el rompecabezas sobre la muerte de sus padres, Parker se enfrenta a dilemas personales, traumas de la infancia y descubrimientos que pueden cambiar por completo su percepción de la vida. El peligro no espera y apenas tendrá tiempo para reaccionar cuando se dé cuenta que un grupo de maleantes y villanos han unido fuerzas con el único propósito de verle destruido. Una batalla final que desvelará el destino de miles de personas.', 'http://image.tmdb.org/t/p/w185/qQ87fVgIsyCpEKdBI6RFWbBZxTJ.jpg', 5.07088),
(949, 478820, 'L\'Empereur de Paris', '2018-12-12', 'fr', '', 'http://image.tmdb.org/t/p/w185', 1.1082),
(950, 428078, 'Mortal Engines', '2018-12-12', 'en', 'En un futuro distópico, las ciudades son gigantes fortalezas en movimiento por el planeta que luchan entre sí por los escasos recursos que aún quedan. Miles de años después de que la civilización fuera destruida por un evento catastrófico, la humanidad se ha adaptado y evolucionado en una nueva forma de vida. Las gigantescas ciudades en movimiento atacan de manera despiadada a los pueblos más pequeños.  Tom Natsworthy y sus compañeros intentarán cambiar el trágico final al que parece que se aboca el planeta.', 'http://image.tmdb.org/t/p/w185/oELiLeTUej6gQTJbAfbF76uZr9b.jpg', 1.79872),
