(1167, 297708, 'Sherlock Holmes 3', '2019-06-15', 'en', 'Tercera entrega cinematográfica de las aventuras del personaje creado por el escritor escocés, Arthur Conan Doyle. Los personajes principales de la saga, Sherlock Holmes (Robert Downey Jr., Iron Man, Marvel Los Vengadores) y su leal compañero, el Doctor Watson (Jude Law, El talento de Mr. Ripley, La invención de Hugo), volverán a vivir una aventura en Sherlock Holmes 3, con nuevos escenarios y nuevos lugares donde se va a desarrollar la historia.', 'http://image.tmdb.org/t/p/w185', 5.21784),
(1168, 380022, 'iPsycho', '2019-06-16', 'en', '', 'http://image.tmdb.org/t/p/w185/7B3Exu1qQJyfZbLzCY3PJUMWNA2.jpg', 1.66027),
(1169, 301528, 'Toy Story 4', '2019-06-20', 'en', 'Las aventuras de este dúo tan carismático les obligarán de nuevo salir al extraño y gigantesco mundo exterior, en una nueva misión imposible. Con la ayuda de sus amigos, pondrán todo su empeño en cumplir su objetivo y volver a casa sanos y salvos. Protegiéndose y apoyándose unos en otros, juntos conseguirán solucionar el gran problema que tienen entre manos y que pone en riesgo su futuro unidos. Hazañas casi imposibles, mucho humor, compañerismo, confianza, y sobretodo, la amistad, serán algunos de los temas que trate esta cuarta parte de la historia de los juguetes animados más conocidos del cine.', 'http://image.tmdb.org/t/p/w185/llVwi8DDyCNIsMuf6G6Vc331PUP.jpg', 1.82967),
