(1327, 401981, 'Gorrión rojo', '2018-03-01', 'en', 'Cuando una lesión pone fin a su carrera, Dominika y su madre se enfrentan a un futuro oscuro e incierto. Por este motivo es manipulada para convertirse en la nueva recluta de una academia de espías, donde las agentes son llamadas “gorriones”. Es una agencia secreta de inteligencia que entrena a jóvenes excepcionales como ella para usar sus cuerpos y mentes como armas. Tras un entrenamiento sádico y perverso, se convierte en la espía “Gorrión” más peligrosa que el programa jamás haya producido. Dominika debe reconciliar la persona que una vez fue con el poder que ahora domina, poniendo su propia vida y la de todos a los que ama en peligro, incluyendo a un agente de la CIA que intenta convencerla de que él es la única persona en quien puede confiar.', 'http://image.tmdb.org/t/p/w185/wt6wL8ZnzqSsg2xUBRdfJn3ELVa.jpg', 38.5158),
