(1344, 437380, 'Bajo la piel de lobo', '2018-03-09', 'es', 'Martín es el último habitante de Auzal, un remoto y pequeño pueblo en las montañas, donde vive en paz con la naturaleza. Desciende hacia los valles dos veces al año, al comienzo de la primavera y al final del verano, donde comercia y consigue provisiones para el resto del año. Pero un día tiene un tórrido y fugaz encuentro con Joxepi, \"la molinera\", y tras esto comienza a plantearse seriamente su actitud de lobo solitario. Así empezará a experimentar nuevos sentimientos, unos sentimientos que cuando afloran ya no pueden reprimirse', 'http://image.tmdb.org/t/p/w185/pBDK1bh9U3nHxVNMto5vyFCVsJe.jpg', 1),
