(1371, 493006, 'Detective Conan 22: El Ejecutor Cero', '2018-04-13', 'ja', 'El nuevo establecimiento \"Edge of Ocean\" que está en la bahía de Tokyo será la nueva sede de la reunión cumbre de Tokyo. El 1 de mayo que se inaugura la cumbre donde más de 22 000 policías están custodiando el enorme establecimiento, ¡ocurre una gran explosión! Allí se encuentra Tooru Amuro, quien es miembro de la organización secreta conocida como \"Zero\" que controla la policía de seguridad pública de todo el país. Conan sospecha del caso de explosión que ocurrió días antes de la cumbre y del misterioso comportamiento de Amuro, que se mueve en secreto. En ese momento se encuentran unas huellas digitales en la escena del crimen y coinciden con las huellas de Kogoro Mouri, ¡quien perteneció a la policía en el pasado! ¿Acaso se trata de una conspiración? Conan y Amuro inician la investigación alrededor del arresto de Kogoro.', 'http://image.tmdb.org/t/p/w185/di2zSuudBxMH8SErGqacaGhneXa.jpg', 1.92375),
