(1399, 399579, 'Alita: Ángel de Combate', '2018-07-19', 'en', 'Ido, un compasivo médico de ciborgs, encuentra a Alita abandonada en el desguace de Iron City. Cuando Alita despierta, no sabe quién es, ni reconoce el mundo en el que se encuentra, todo es nuevo para ella. Ido intentará proteger a Alita de su misterioso pasado, mientras que su nuevo amigo Hugo le ayudará a despertar sus recuerdos. En ese momento, Alita descubre que posee habilidades de combate extraordinarias, que podría usar para salvar a su nueva familia y amigos. Decidida a descubrir la verdad tras sus orígenes, Alita comienza un viaje que le enfrentará a las injusticias de un mundo oscuro y corrupto, descubriendo que solo ella puede cambiar el mundo en el que vive.', 'http://image.tmdb.org/t/p/w185/oecJvFDBahI7lwlDHX7PyExGXrJ.jpg', 4.66018),
