(1410, 400650, 'Mary Poppins Returns', '2018-12-19', 'en', 'En la era de la Depresión de Londres, un ahora crecidos Jane y Michael Banks, junto con los tres hijos de Michael, son visitados por la enigmática Mary Poppins después de la pérdida de un pariente. A través de sus habilidades mágicas únicas, y con la ayuda de su amigo Jack, ella ayuda a la familia a redescubrir la alegría y la maravilla que falta en sus vidas.', 'http://image.tmdb.org/t/p/w185/a7Vy8LwRumEKlYCCvpuh5uFcb5M.jpg', 3.95636),
