(1441, 421792, 'Down a Dark Hall', '2018-12-31', 'en', 'Kit Gordy contempla Blackwood Hall alzándose sobre negras puertas de hierro y no puede evitar el pensar: este lugar es malvado. La imponente mansión aguijonea el miedo en ella. Pero Kitt se asienta en una rutina, tratando de ignorar los rumores acerca de que esta exclusivísima escuela privada está encantada. Pronto, sus compañeros comenzarán a mostrar extraordinarios y desconocidos talentos. Los bizarros sueños, las voces, las cartas perdidas a familia y amigos, todo ello se ve ensombrecido por la magia que la rodea. Cuando Kit y sus amigos descubran que Blackwood no es lo que parece, tal vez ya sea demasiado tarde. (FILMAFFINITY)', 'http://image.tmdb.org/t/p/w185/sU2nzGTxP3VmKiKGC9llQMIFZWt.jpg', 1.38221),
